import { useState } from "react";
import "./App.css";
import Login from "../Login/login";
import { signInWithGoogle } from "../Firebase/google";
function App() {
  const [display, setDisplay] = useState("");

  function handleGoogle() {
    const user = signInWithGoogle();
    console.log(user);
    setDisplay(user);
  }

  return (
    <div className="App">
      <Login handleClick={handleGoogle} />
      <h1>{display}</h1>
    </div>
  );
}

export default App;
